		"A Calça Stryke TDU da 5.11 proporciona flexibilidade de alto desempenho, durabilidade e versatilidade necessária para atividades extremas em ambientes táticos. Desenvolvida com o nosso tecido Flex-Tac® de elasticidade mecânica com acabamento da estrutura em pespontos, a Calça Stryke TDU da 5.11 é feita para uso em situações difíceis. Com joelhos articulados de camada dupla, uma entreperna totalmente forrada e seções elásticas na cintura e nos joelhos, proporciona um ajuste firme e flexível mesmo quando você está em movimento. Bolsos cargo ergonômicos, bolsos no quadril e bolsos no joelho para as joelheiras da 5.11 disponíveis que oferecem proteção. É hora de rolar. Importada."
